            <h1> Welcom Admin! </h1>
            <div>
              <h2> Users </h2>

              <ul>
               {users && users.map((user, index)=>(
                <li key={index}>
                  {user.username} 
                </li>
               ))} 

              </ul>

            </div>
        </div>
      </>
    )
}

export default Dashboard;
